def __new__(cls, data=None, dtype=None, copy=False, name=None, tupleize_cols=True, **kwargs) -> 'Index':
    from pandas.core.indexes.range import RangeIndex
    name = maybe_extract_name(name, data, cls)
    if isinstance(data, ABCPandasArray):
        data = data.to_numpy()
    if isinstance(data, RangeIndex):
        return RangeIndex(start=data, copy=copy, dtype=dtype, name=name)
    elif isinstance(data, range):
        return RangeIndex.from_range(data, dtype=dtype, name=name)
    elif is_categorical_dtype(data) or is_categorical_dtype(dtype):
        from pandas.core.indexes.category import CategoricalIndex
        return CategoricalIndex(data, dtype=dtype, copy=copy, name=name, **kwargs)
    elif is_interval_dtype(data) or is_interval_dtype(dtype):
        from pandas.core.indexes.interval import IntervalIndex
        closed = kwargs.pop('closed', None)
        if is_dtype_equal(_o_dtype, dtype):
            return IntervalIndex(data, name=name, copy=copy, closed=closed, **kwargs).astype(object)
        return IntervalIndex(data, dtype=dtype, name=name, copy=copy, closed=closed, **kwargs)
    elif is_datetime64_any_dtype(data) or is_datetime64_any_dtype(dtype) or 'tz' in kwargs:
        from pandas import DatetimeIndex
        if is_dtype_equal(_o_dtype, dtype):
            return DatetimeIndex(data, copy=False, name=name, **kwargs).astype(object)
        else:
            return DatetimeIndex(data, copy=copy, name=name, dtype=dtype, **kwargs)
    elif is_timedelta64_dtype(data) or is_timedelta64_dtype(dtype):
        from pandas import TimedeltaIndex
        if is_dtype_equal(_o_dtype, dtype):
            return TimedeltaIndex(data, copy=False, name=name, **kwargs).astype(object)
        else:
            return TimedeltaIndex(data, copy=copy, name=name, dtype=dtype, **kwargs)
    elif is_period_dtype(data) or is_period_dtype(dtype):
        from pandas import PeriodIndex
        if is_dtype_equal(_o_dtype, dtype):
            return PeriodIndex(data, copy=False, name=name, **kwargs).astype(object)
        return PeriodIndex(data, dtype=dtype, copy=copy, name=name, **kwargs)
    elif is_extension_array_dtype(data) or is_extension_array_dtype(dtype):
        if not (dtype is None or is_object_dtype(dtype)):
            ea_cls = dtype.construct_array_type()
            data = ea_cls._from_sequence(data, dtype=dtype, copy=False)
        else:
            data = np.asarray(data, dtype=object)
        data = data.astype(object)
        return Index(data, dtype=object, copy=copy, name=name, **kwargs)
    elif isinstance(data, (np.ndarray, Index, ABCSeries)):
        from pandas.core.indexes.numeric import Float64Index, Int64Index, UInt64Index
        if dtype is not None:
            data = _maybe_cast_with_dtype(data, dtype, copy)
            dtype = data.dtype
        if is_signed_integer_dtype(data.dtype):
            return Int64Index(data, copy=copy, dtype=dtype, name=name)
        elif is_unsigned_integer_dtype(data.dtype):
            return UInt64Index(data, copy=copy, dtype=dtype, name=name)
        elif is_float_dtype(data.dtype):
            return Float64Index(data, copy=copy, dtype=dtype, name=name)
        elif issubclass(data.dtype.type, np.bool) or is_bool_dtype(data):
            subarr = data.astype('object')
        else:
            subarr = com.asarray_tuplesafe(data, dtype=object)
        if copy:
            subarr = subarr.copy()
        if dtype is None:
            new_data, new_dtype = _maybe_cast_data_without_dtype(subarr)
            if new_dtype is not None:
                return cls(new_data, dtype=new_dtype, copy=False, name=name, **kwargs)
        if kwargs:
            raise TypeError(f'Unexpected keyword arguments {repr(set(kwargs))}')
        if subarr.ndim > 1:
            raise ValueError('Index data must be 1-dimensional')
        return cls._simple_new(subarr, name)
    elif hasattr(data, '__array__'):
        return Index(np.asarray(data), dtype=dtype, copy=copy, name=name, **kwargs)
    elif data is None or is_scalar(data):
        raise cls._scalar_data_error(data)
    else:
        if tupleize_cols and is_list_like(data):
            if is_iterator(data):
                data = list(data)
            if data and all((isinstance(e, tuple) for e in data)):
                from pandas.core.indexes.multi import MultiIndex
                return MultiIndex.from_tuples(data, names=name or kwargs.get('names'))
        subarr = com.asarray_tuplesafe(data, dtype=object)
        return Index(subarr, dtype=dtype, copy=copy, name=name, **kwargs)

@cache_readonly
def _constructor(self):
    return type(self)

def _get_attributes_dict(self):
    """
    Return an attributes dict for my class.
    """
    return {k: getattr(self, k, None) for k in self._attributes}

def _shallow_copy_with_infer(self, values, **kwargs):
    """
    Create a new Index inferring the class with passed value, don't copy
    the data, use the same object attributes with passed in attributes
    taking precedence.

    *this is an internal non-public method*

    Parameters
    ----------
    values : the values to create the new Index, optional
    kwargs : updates the default attributes for this Index
    """
    attributes = self._get_attributes_dict()
    attributes.update(kwargs)
    attributes['copy'] = False
    if not len(values) and 'dtype' not in kwargs:
        attributes['dtype'] = self.dtype
    if self._infer_as_myclass:
        try:
            return self._constructor(values, **attributes)
        except (TypeError, ValueError):
            pass
    return Index(values, **attributes)

@cache_readonly
def _engine(self):
    _ndarray_values = self._ndarray_values
    return self._engine_type(lambda: _ndarray_values, len(self))

def __len__(self) -> int:
    """
    Return the length of the Index.
    """
    return len(self._data)

def __array__(self, dtype=None) -> np.ndarray:
    """
    The array interface, return my values.
    """
    return np.asarray(self._data, dtype=dtype)

def __array_wrap__(self, result, context=None):
    """
    Gets called after a ufunc.
    """
    result = lib.item_from_zerodim(result)
    if is_bool_dtype(result) or lib.is_scalar(result) or np.ndim(result) > 1:
        return result
    attrs = self._get_attributes_dict()
    return Index(result, **attrs)

@cache_readonly
def dtype(self):
    """
    Return the dtype object of the underlying data.
    """
    return self._data.dtype

def view(self, cls=None):
    if cls is not None and (not hasattr(cls, '_typ')):
        result = self._data.view(cls)
    else:
        result = self._shallow_copy()
    if isinstance(result, Index):
        result._id = self._id
    return result

@Appender(_index_shared_docs['take'] % _index_doc_kwargs)
def take(self, indices, axis=0, allow_fill=True, fill_value=None, **kwargs):
    if kwargs:
        nv.validate_take(tuple(), kwargs)
    indices = ensure_platform_int(indices)
    if self._can_hold_na:
        taken = self._assert_take_fillable(self.values, indices, allow_fill=allow_fill, fill_value=fill_value, na_value=self._na_value)
    else:
        if allow_fill and fill_value is not None:
            cls_name = type(self).__name__
            raise ValueError(f'Unable to fill values because {cls_name} cannot contain NA')
        taken = self.values.take(indices)
    return self._shallow_copy(taken)

def _assert_take_fillable(self, values, indices, allow_fill=True, fill_value=None, na_value=np.nan):
    """
    Internal method to handle NA filling of take.
    """
    indices = ensure_platform_int(indices)
    if allow_fill and fill_value is not None:
        if (indices < -1).any():
            raise ValueError('When allow_fill=True and fill_value is not None, all indices must be >= -1')
        taken = algos.take(values, indices, allow_fill=allow_fill, fill_value=na_value)
    else:
        taken = values.take(indices)
    return taken

@Appender(_index_shared_docs['repeat'] % _index_doc_kwargs)
def repeat(self, repeats, axis=None):
    repeats = ensure_platform_int(repeats)
    nv.validate_repeat(tuple(), dict(axis=axis))
    return self._shallow_copy(self._values.repeat(repeats))

@property
def _formatter_func(self):
    """
    Return the formatter function.
    """
    return default_pprint

def _format_data(self, name=None) -> str_t:
    """
    Return the formatted data as a unicode string.
    """
    is_justify = True
    if self.inferred_type == 'string':
        is_justify = False
    elif self.inferred_type == 'categorical':
        if is_object_dtype(self.categories):
            is_justify = False
    return format_object_summary(self, self._formatter_func, is_justify=is_justify, name=name)

def _format_attrs(self):
    """
    Return a list of tuples of the (attr,formatted_value).
    """
    return format_object_attrs(self)

def format(self, name: bool=False, formatter=None, **kwargs):
    """
    Render a string representation of the Index.
    """
    header = []
    if name:
        header.append(pprint_thing(self.name, escape_chars=('\t', '\r', '\n')) if self.name is not None else '')
    if formatter is not None:
        return header + list(self.map(formatter))
    return self._format_with_header(header, **kwargs)

def _format_with_header(self, header, na_rep='NaN', **kwargs):
    values = self.values
    from pandas.io.formats.format import format_array
    if is_categorical_dtype(values.dtype):
        values = np.array(values)
    elif is_object_dtype(values.dtype):
        values = lib.maybe_convert_objects(values, safe=1)
    if is_object_dtype(values.dtype):
        result = [pprint_thing(x, escape_chars=('\t', '\r', '\n')) for x in values]
        mask = isna(values)
        if mask.any():
            result = np.array(result)
            result[mask] = na_rep
            result = result.tolist()
    else:
        result = _trim_front(format_array(values, None, justify='left'))
    return header + result

@property
def name(self):
    """
    Return Index or MultiIndex name.
    """
    return self._name

@name.setter
def name(self, value):
    if self._no_setting_name:
        raise RuntimeError("Cannot set name on a level of a MultiIndex. Use 'MultiIndex.set_names' instead.")
    maybe_extract_name(value, None, type(self))
    self._name = value

def _validate_names(self, name=None, names=None, deep: bool=False):
    """
    Handles the quirks of having a singular 'name' parameter for general
    Index and plural 'names' parameter for MultiIndex.
    """
    from copy import deepcopy
    if names is not None and name is not None:
        raise TypeError('Can only provide one of `names` and `name`')
    elif names is None and name is None:
        return deepcopy(self.names) if deep else self.names
    elif names is not None:
        if not is_list_like(names):
            raise TypeError('Must pass list-like as `names`.')
        return names
    else:
        if not is_list_like(name):
            return [name]
        return name

@property
def nlevels(self) -> int:
    """
    Number of levels.
    """
    return 1

def _validate_index_level(self, level):
    """
    Validate index level.

    For single-level Index getting level number is a no-op, but some
    verification must be done like in MultiIndex.

    """
    if isinstance(level, int):
        if level < 0 and level != -1:
            raise IndexError(f'Too many levels: Index has only 1 level, {level} is not a valid level number')
        elif level > 0:
            raise IndexError(f'Too many levels: Index has only 1 level, not {level + 1}')
    elif level != self.name:
        raise KeyError(f'Requested level ({level}) does not match index name ({self.name})')

def _get_level_number(self, level) -> int:
    self._validate_index_level(level)
    return 0

@property
def is_monotonic(self) -> bool:
    """
    Alias for is_monotonic_increasing.
    """
    return self.is_monotonic_increasing

@cache_readonly
def is_unique(self) -> bool:
    """
    Return if the index has unique values.
    """
    return self._engine.is_unique

@cache_readonly
def inferred_type(self) -> str_t:
    """
    Return a string of the type inferred from the values.
    """
    return lib.infer_dtype(self, skipna=False)

@cache_readonly
def is_all_dates(self) -> bool:
    """
    Whether or not the index values only consist of dates.
    """
    return is_datetime_array(ensure_object(self.values))

def __reduce__(self):
    d = dict(data=self._data)
    d.update(self._get_attributes_dict())
    return (_new_Index, (type(self), d), None)

@cache_readonly
def _isnan(self):
    """
    Return if each value is NaN.
    """
    if self._can_hold_na:
        return isna(self)
    else:
        values = np.empty(len(self), dtype=np.bool_)
        values.fill(False)
        return values

@cache_readonly
def _nan_idxs(self):
    if self._can_hold_na:
        return self._isnan.nonzero()[0]
    else:
        return np.array([], dtype=np.int64)

@cache_readonly
def hasnans(self) -> bool:
    """
    Return if I have any nans; enables various perf speedups.
    """
    if self._can_hold_na:
        return bool(self._isnan.any())
    else:
        return False

def _get_unique_index(self, dropna: bool=False):
    """
    Returns an index containing unique values.

    Parameters
    ----------
    dropna : bool, default False
        If True, NaN values are dropped.

    Returns
    -------
    uniques : index
    """
    if self.is_unique and (not dropna):
        return self
    values = self.values
    if not self.is_unique:
        values = self.unique()
        if not isinstance(self, ABCMultiIndex):
            values = values._data
    if dropna:
        try:
            if self.hasnans:
                values = values[~isna(values)]
        except NotImplementedError:
            pass
    return self._shallow_copy(values)

def __add__(self, other):
    if isinstance(other, (ABCSeries, ABCDataFrame)):
        return NotImplemented
    from pandas import Series
    return Index(Series(self) + other)

def __radd__(self, other):
    from pandas import Series
    return Index(other + Series(self))

def __rsub__(self, other):
    from pandas import Series
    return Index(other - Series(self))

def _get_reconciled_name_object(self, other):
    """
    If the result of a set operation will be self,
    return self, unless the name changes, in which
    case make a shallow copy of self.
    """
    name = get_op_result_name(self, other)
    if self.name != name:
        return self._shallow_copy(name=name)
    return self

def _validate_sort_keyword(self, sort):
    if sort not in [None, False]:
        raise ValueError(f"The 'sort' keyword only takes the values of None or False; {sort} was passed.")

def _union(self, other, sort):
    """
    Specific union logic should go here. In subclasses, union behavior
    should be overwritten here rather than in `self.union`.

    Parameters
    ----------
    other : Index or array-like
    sort : False or None, default False
        Whether to sort the resulting index.

        * False : do not sort the result.
        * None : sort the result, except when `self` and `other` are equal
          or when the values cannot be compared.

    Returns
    -------
    Index
    """
    if not len(other) or self.equals(other):
        return self._get_reconciled_name_object(other)
    if not len(self):
        return other._get_reconciled_name_object(self)
    if is_datetime64tz_dtype(self):
        lvals = self._ndarray_values
    else:
        lvals = self._values
    if is_datetime64tz_dtype(other):
        rvals = other._ndarray_values
    else:
        rvals = other._values
    if sort is None and self.is_monotonic and other.is_monotonic:
        try:
            result = self._outer_indexer(lvals, rvals)[0]
        except TypeError:
            result = list(lvals)
            value_set = set(lvals)
            result.extend([x for x in rvals if x not in value_set])
            result = Index(result)._values
    else:
        if self.is_unique:
            indexer = self.get_indexer(other)
            indexer = (indexer == -1).nonzero()[0]
        else:
            indexer = algos.unique1d(self.get_indexer_non_unique(other)[1])
        if len(indexer) > 0:
            other_diff = algos.take_nd(rvals, indexer, allow_fill=False)
            result = concat_compat((lvals, other_diff))
        else:
            result = lvals
        if sort is None:
            try:
                result = algos.safe_sort(result)
            except TypeError as err:
                warnings.warn(f'{err}, sort order is undefined for incomparable objects', RuntimeWarning, stacklevel=3)
    return self._wrap_setop_result(other, result)

def _wrap_setop_result(self, other, result):
    name = get_op_result_name(self, other)
    return self._shallow_copy(result, name=name)

def _assert_can_do_setop(self, other):
    if not is_list_like(other):
        raise TypeError('Input must be Index or array-like')
    return True

def _convert_can_do_setop(self, other):
    if not isinstance(other, Index):
        other = Index(other, name=self.name)
        result_name = self.name
    else:
        result_name = get_op_result_name(self, other)
    return (other, result_name)

@Appender(_index_shared_docs['get_indexer'] % _index_doc_kwargs)
def get_indexer(self, target, method=None, limit=None, tolerance=None) -> np.ndarray:
    method = missing.clean_reindex_fill_method(method)
    target = ensure_index(target)
    if tolerance is not None:
        tolerance = self._convert_tolerance(tolerance, target)
    if target.is_boolean() and self.is_numeric():
        return ensure_platform_int(np.repeat(-1, target.size))
    pself, ptarget = self._maybe_promote(target)
    if pself is not self or ptarget is not target:
        return pself.get_indexer(ptarget, method=method, limit=limit, tolerance=tolerance)
    if not is_dtype_equal(self.dtype, target.dtype):
        this = self.astype(object)
        target = target.astype(object)
        return this.get_indexer(target, method=method, limit=limit, tolerance=tolerance)
    if not self.is_unique:
        raise InvalidIndexError('Reindexing only valid with uniquely valued Index objects')
    if method == 'pad' or method == 'backfill':
        indexer = self._get_fill_indexer(target, method, limit, tolerance)
    elif method == 'nearest':
        indexer = self._get_nearest_indexer(target, limit, tolerance)
    else:
        if tolerance is not None:
            raise ValueError('tolerance argument only valid if doing pad, backfill or nearest reindexing')
        if limit is not None:
            raise ValueError('limit argument only valid if doing pad, backfill or nearest reindexing')
        indexer = self._engine.get_indexer(target._ndarray_values)
    return ensure_platform_int(indexer)

def _convert_tolerance(self, tolerance, target):
    tolerance = np.asarray(tolerance)
    if target.size != tolerance.size and tolerance.size > 1:
        raise ValueError('list-like tolerance size must match target index size')
    return tolerance

def _get_fill_indexer(self, target: 'Index', method: str_t, limit=None, tolerance=None) -> np.ndarray:
    if self.is_monotonic_increasing and target.is_monotonic_increasing:
        engine_method = self._engine.get_pad_indexer if method == 'pad' else self._engine.get_backfill_indexer
        indexer = engine_method(target._ndarray_values, limit)
    else:
        indexer = self._get_fill_indexer_searchsorted(target, method, limit)
    if tolerance is not None:
        indexer = self._filter_indexer_tolerance(target._ndarray_values, indexer, tolerance)
    return indexer

def _convert_scalar_indexer(self, key, kind=None):
    """
    Convert a scalar indexer.

    Parameters
    ----------
    key : label of the slice bound
    kind : {'loc', 'getitem', 'iloc'} or None
    """
    assert kind in ['loc', 'getitem', 'iloc', None]
    if kind == 'iloc':
        self._validate_indexer('positional', key, 'iloc')
        return key
    if len(self) and (not isinstance(self, ABCMultiIndex)):
        if kind == 'getitem' and is_float(key):
            if not self.is_floating():
                self._invalid_indexer('label', key)
        elif kind == 'loc' and is_float(key):
            if self.inferred_type not in ['floating', 'mixed-integer-float', 'integer-na', 'string', 'mixed']:
                self._invalid_indexer('label', key)
        elif kind == 'loc' and is_integer(key):
            if not self.holds_integer():
                self._invalid_indexer('label', key)
    return key

def _convert_slice_indexer(self, key: slice, kind=None):
    """
    Convert a slice indexer.

    By definition, these are labels unless 'iloc' is passed in.
    Floats are not allowed as the start, step, or stop of the slice.

    Parameters
    ----------
    key : label of the slice bound
    kind : {'loc', 'getitem', 'iloc'} or None
    """
    assert kind in ['loc', 'getitem', 'iloc', None]
    if kind == 'iloc':
        self._validate_indexer('slice', key.start, 'iloc')
        self._validate_indexer('slice', key.stop, 'iloc')
        self._validate_indexer('slice', key.step, 'iloc')
        return key
    start, stop, step = (key.start, key.stop, key.step)

    def is_int(v):
        return v is None or is_integer(v)
    is_null_slicer = start is None and stop is None
    is_index_slice = is_int(start) and is_int(stop)
    is_positional = is_index_slice and (not (self.is_integer() or self.is_categorical()))
    if kind == 'getitem':
        '\n            called from the getitem slicers, validate that we are in fact\n            integers\n            '
        if self.is_integer() or is_index_slice:
            self._validate_indexer('slice', key.start, 'getitem')
            self._validate_indexer('slice', key.stop, 'getitem')
            self._validate_indexer('slice', key.step, 'getitem')
            return key
    try:
        if is_positional and self.is_mixed():
            if start is not None:
                self.get_loc(start)
            if stop is not None:
                self.get_loc(stop)
            is_positional = False
    except KeyError:
        if self.inferred_type in ['mixed-integer-float', 'integer-na']:
            raise
    if is_null_slicer:
        indexer = key
    elif is_positional:
        indexer = key
    else:
        indexer = self.slice_indexer(start, stop, step, kind=kind)
    return indexer

def reindex(self, target, method=None, level=None, limit=None, tolerance=None):
    """
    Create index with target's values (move/add/delete values
    as necessary).

    Parameters
    ----------
    target : an iterable

    Returns
    -------
    new_index : pd.Index
        Resulting index.
    indexer : np.ndarray or None
        Indices of output values in original index.
    """
    preserve_names = not hasattr(target, 'name')
    target = _ensure_has_len(target)
    if not isinstance(target, Index) and len(target) == 0:
        attrs = self._get_attributes_dict()
        attrs.pop('freq', None)
        if isinstance(self, ABCRangeIndex):
            values = range(0)
        else:
            values = self._data[:0]
        target = self._simple_new(values, dtype=self.dtype, **attrs)
    else:
        target = ensure_index(target)
    if level is not None:
        if method is not None:
            raise TypeError('Fill method not supported if level passed')
        _, indexer, _ = self._join_level(target, level, how='right', return_indexers=True)
    elif self.equals(target):
        indexer = None
    elif self.is_unique and (not getattr(self, 'is_overlapping', False)):
        indexer = self.get_indexer(target, method=method, limit=limit, tolerance=tolerance)
    else:
        if method is not None or limit is not None:
            raise ValueError('cannot reindex a non-unique index with a method or limit')
        indexer, missing = self.get_indexer_non_unique(target)
    if preserve_names and target.nlevels == 1 and (target.name != self.name):
        target = target.copy()
        target.name = self.name
    return (target, indexer)

def join(self, other, how='left', level=None, return_indexers=False, sort=False):
    """
    Compute join_index and indexers to conform data
    structures to the new index.

    Parameters
    ----------
    other : Index
    how : {'left', 'right', 'inner', 'outer'}
    level : int or level name, default None
    return_indexers : bool, default False
    sort : bool, default False
        Sort the join keys lexicographically in the result Index. If False,
        the order of the join keys depends on the join type (how keyword).

    Returns
    -------
    join_index, (left_indexer, right_indexer)
    """
    self_is_mi = isinstance(self, ABCMultiIndex)
    other_is_mi = isinstance(other, ABCMultiIndex)
    if level is None and (self_is_mi or other_is_mi):
        if self.names == other.names:
            pass
        else:
            return self._join_multi(other, how=how, return_indexers=return_indexers)
    if level is not None and (self_is_mi or other_is_mi):
        return self._join_level(other, level, how=how, return_indexers=return_indexers)
    other = ensure_index(other)
    if len(other) == 0 and how in ('left', 'outer'):
        join_index = self._shallow_copy()
        if return_indexers:
            rindexer = np.repeat(-1, len(join_index))
            return (join_index, None, rindexer)
        else:
            return join_index
    if len(self) == 0 and how in ('right', 'outer'):
        join_index = other._shallow_copy()
        if return_indexers:
            lindexer = np.repeat(-1, len(join_index))
            return (join_index, lindexer, None)
        else:
            return join_index
    if self._join_precedence < other._join_precedence:
        how = {'right': 'left', 'left': 'right'}.get(how, how)
        result = other.join(self, how=how, level=level, return_indexers=return_indexers)
        if return_indexers:
            x, y, z = result
            result = (x, z, y)
        return result
    if not is_dtype_equal(self.dtype, other.dtype):
        this = self.astype('O')
        other = other.astype('O')
        return this.join(other, how=how, return_indexers=return_indexers)
    _validate_join_method(how)
    if not self.is_unique and (not other.is_unique):
        return self._join_non_unique(other, how=how, return_indexers=return_indexers)
    elif not self.is_unique or not other.is_unique:
        if self.is_monotonic and other.is_monotonic:
            return self._join_monotonic(other, how=how, return_indexers=return_indexers)
        else:
            return self._join_non_unique(other, how=how, return_indexers=return_indexers)
    elif self.is_monotonic and other.is_monotonic:
        try:
            return self._join_monotonic(other, how=how, return_indexers=return_indexers)
        except TypeError:
            pass
    if how == 'left':
        join_index = self
    elif how == 'right':
        join_index = other
    elif how == 'inner':
        join_index = self.intersection(other, sort=False)
    elif how == 'outer':
        join_index = self.union(other)
    if sort:
        join_index = join_index.sort_values()
    if return_indexers:
        if join_index is self:
            lindexer = None
        else:
            lindexer = self.get_indexer(join_index)
        if join_index is other:
            rindexer = None
        else:
            rindexer = other.get_indexer(join_index)
        return (join_index, lindexer, rindexer)
    else:
        return join_index

def _join_non_unique(self, other, how='left', return_indexers=False):
    from pandas.core.reshape.merge import _get_join_indexers
    left_idx, right_idx = _get_join_indexers([self._ndarray_values], [other._ndarray_values], how=how, sort=True)
    left_idx = ensure_platform_int(left_idx)
    right_idx = ensure_platform_int(right_idx)
    join_index = np.asarray(self._ndarray_values.take(left_idx))
    mask = left_idx == -1
    np.putmask(join_index, mask, other._ndarray_values.take(right_idx))
    join_index = self._wrap_joined_index(join_index, other)
    if return_indexers:
        return (join_index, left_idx, right_idx)
    else:
        return join_index

def _join_monotonic(self, other, how='left', return_indexers=False):
    if self.equals(other):
        ret_index = other if how == 'right' else self
        if return_indexers:
            return (ret_index, None, None)
        else:
            return ret_index
    sv = self._ndarray_values
    ov = other._ndarray_values
    if self.is_unique and other.is_unique:
        if how == 'left':
            join_index = self
            lidx = None
            ridx = self._left_indexer_unique(sv, ov)
        elif how == 'right':
            join_index = other
            lidx = self._left_indexer_unique(ov, sv)
            ridx = None
        elif how == 'inner':
            join_index, lidx, ridx = self._inner_indexer(sv, ov)
            join_index = self._wrap_joined_index(join_index, other)
        elif how == 'outer':
            join_index, lidx, ridx = self._outer_indexer(sv, ov)
            join_index = self._wrap_joined_index(join_index, other)
    else:
        if how == 'left':
            join_index, lidx, ridx = self._left_indexer(sv, ov)
        elif how == 'right':
            join_index, ridx, lidx = self._left_indexer(ov, sv)
        elif how == 'inner':
            join_index, lidx, ridx = self._inner_indexer(sv, ov)
        elif how == 'outer':
            join_index, lidx, ridx = self._outer_indexer(sv, ov)
        join_index = self._wrap_joined_index(join_index, other)
    if return_indexers:
        lidx = None if lidx is None else ensure_platform_int(lidx)
        ridx = None if ridx is None else ensure_platform_int(ridx)
        return (join_index, lidx, ridx)
    else:
        return join_index

def _wrap_joined_index(self, joined, other):
    name = get_op_result_name(self, other)
    return Index(joined, name=name)

