def __getitem__(self, key):
    """
    Override numpy.ndarray's __getitem__ method to work as desired.

    This function adds lists and Series as valid boolean indexers
    (ndarrays only supports ndarray with dtype=bool).

    If resulting ndim != 1, plain ndarray is returned instead of
    corresponding `Index` subclass.

    """
    getitem = self._data.__getitem__
    promote = self._shallow_copy
    if is_scalar(key):
        key = com.cast_scalar_indexer(key)
        return getitem(key)
    if isinstance(key, slice):
        return promote(getitem(key))
    if com.is_bool_indexer(key):
        key = np.asarray(key, dtype=bool)
    key = com.values_from_object(key)
    result = getitem(key)
    if not is_scalar(result):
        if np.ndim(result) > 1:
            deprecate_ndim_indexing(result)
            return result
        return promote(result)
    else:
        return result

def append(self, other):
    """
    Append a collection of Index options together.

    Parameters
    ----------
    other : Index or list/tuple of indices

    Returns
    -------
    appended : Index
    """
    to_concat = [self]
    if isinstance(other, (list, tuple)):
        to_concat = to_concat + list(other)
    else:
        to_concat.append(other)
    for obj in to_concat:
        if not isinstance(obj, Index):
            raise TypeError('all inputs must be Index')
    names = {obj.name for obj in to_concat}
    name = None if len(names) > 1 else self.name
    return self._concat(to_concat, name)

def _concat(self, to_concat, name):
    typs = _concat.get_dtype_kinds(to_concat)
    if len(typs) == 1:
        return self._concat_same_dtype(to_concat, name=name)
    return Index._concat_same_dtype(self, to_concat, name=name)

def putmask(self, mask, value):
    """
    Return a new Index of the values set with the mask.

    Returns
    -------
    Index

    See Also
    --------
    numpy.ndarray.putmask
    """
    values = self.values.copy()
    try:
        np.putmask(values, mask, self._convert_for_op(value))
        return self._shallow_copy(values)
    except (ValueError, TypeError) as err:
        if is_object_dtype(self):
            raise err
        return self.astype(object).putmask(mask, value)

def equals(self, other) -> bool:
    """
    Determine if two Index objects contain the same elements.

    Returns
    -------
    bool
        True if "other" is an Index and it has the same elements as calling
        index; False otherwise.
    """
    if self.is_(other):
        return True
    if not isinstance(other, Index):
        return False
    if is_object_dtype(self) and (not is_object_dtype(other)):
        return other.equals(self)
    if isinstance(other, ABCMultiIndex):
        if not is_object_dtype(self.dtype):
            if self.nlevels != other.nlevels:
                return False
    return array_equivalent(com.values_from_object(self), com.values_from_object(other))

def get_value(self, series: 'Series', key):
    """
    Fast lookup of value from 1-dimensional ndarray. Only use this if you
    know what you're doing.

    Returns
    -------
    scalar or Series
    """
    if not is_scalar(key):
        raise InvalidIndexError(key)
    try:
        loc = self._engine.get_loc(key)
    except KeyError:
        if len(self) > 0 and (self.holds_integer() or self.is_boolean()):
            raise
        elif is_integer(key):
            loc = key
        else:
            raise
    return self._get_values_for_loc(series, loc)

