def _searchsorted_monotonic(self, label, side='left'):
    if self.is_monotonic_increasing:
        return self.searchsorted(label, side=side)
    elif self.is_monotonic_decreasing:
        pos = self[::-1].searchsorted(label, side='right' if side == 'left' else 'left')
        return len(self) - pos
    raise ValueError('index must be monotonic increasing or decreasing')

def get_slice_bound(self, label, side: str_t, kind) -> int:
    """
    Calculate slice bound that corresponds to given label.

    Returns leftmost (one-past-the-rightmost if ``side=='right'``) position
    of given label.

    Parameters
    ----------
    label : object
    side : {'left', 'right'}
    kind : {'loc', 'getitem'} or None

    Returns
    -------
    int
        Index of label.
    """
    assert kind in ['loc', 'getitem', None]
    if side not in ('left', 'right'):
        raise ValueError(f"Invalid value for side kwarg, must be either 'left' or 'right': {side}")
    original_label = label
    label = self._maybe_cast_slice_bound(label, side, kind)
    try:
        slc = self.get_loc(label)
    except KeyError as err:
        try:
            return self._searchsorted_monotonic(label, side)
        except ValueError:
            raise err
    if isinstance(slc, np.ndarray):
        if is_bool_dtype(slc):
            slc = lib.maybe_booleans_to_slice(slc.view('u1'))
        else:
            slc = lib.maybe_indices_to_slice(slc.astype('i8'), len(self))
        if isinstance(slc, np.ndarray):
            raise KeyError(f'Cannot get {side} slice bound for non-unique label: {repr(original_label)}')
    if isinstance(slc, slice):
        if side == 'left':
            return slc.start
        else:
            return slc.stop
    elif side == 'right':
        return slc + 1
    else:
        return slc

@classmethod
def _add_numeric_methods_unary(cls):
